import React from 'react';

const Form = props => (
  <form onSubmit={props.getArtist} style={{ marginBottom:"2rem" }}>
    <input className="form__input" type="text" name="artistName" placeholder="Artist Name"/>
    <button className="form__button">Search</button>
  </form>
);

export default Form;
